import React from 'react';
import { useLocation } from 'react-router-dom';
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import './Style.css';

export default function Third() {
    const location = useLocation();
    const navigate = useNavigate();

    const data = location.state?.data || [];

    const handleDelete = (id) => {
        axios.delete(`http://localhost:8070/router/delete/${id}`)
            .then(response => {
                console.log(response.data);
                navigate('/First');
            })
            .catch(error => {
                console.error('There was an error deleting the record!', error);
            });
    };

    const handleUpdate = (item) => {
        navigate('/Update', { state: { data: item } }); 
    };


    return (
        <div class="bg-secondary">
            <h1>Search Results</h1>

            <ul>
                {data.map(item => (
                    <li key={item._id}>
                        <table class="table table-striped">
  <thead>
    <tr>
      <th scope="col">Team</th>
      <th scope="col">Date</th>
      <th scope="col">Operatorname</th>
      <th scope="col">Operatorgrade</th>
      <th scope="col">Operationname</th>
      <th scope="col">Operatorgrade</th>
      <th scope="col">adjustedTime</th>
      <th scope="col">piecesPerHour</th>
    </tr>
  </thead>
  <tbody>
  <tr>
            <td>   {item.team} </td>   <td>{item.date} </td> <td>{item.Operatorname} </td> <td>{item.Operatorgrade} </td> <td>{item.Operationname} </td> <td>{item.Operationgrade} </td> <td>{item.adjustedTime} </td> <td>{item.piecesPerHour}</td>
    <button onClick={() => handleUpdate(item)} class="btn btn-outline-dark update">Update</button>
                        <button onClick={() => handleDelete(item._id)} class="btn btn-outline-dark delete">Delete</button> 
                        </tr>
                        </tbody>
                        </table>
                    </li>
                ))}
            </ul>
            
            </div>
    );
} 
            
